import React, { useEffect } from 'react';
import CheckLogin from '../../assents/checkLogin';
import { useNavigate } from 'react-router-dom';
import ViewPost from './viewPosts/viewPost';
import CreatePost from './createPost/createPost';
import { Container } from './styledPost';

export default function Post() {
	CheckLogin();
	const navigate = useNavigate();

	const logout = () => {
		localStorage.removeItem('tokenEddit');
		navigate('/');
	};
  const home = () => {
		navigate('/');
	};

	return (
		<Container>
			<Contain>
				<button onClick={home}>Voltar p/ Home</button>
				<h1> Todos os Posts</h1>
				<button onClick={logout}>Fazer logout</button>
			</Contain>
			<CreatePost />
			<ViewPost />
		</Container>
	);
}
